import React, { useRef, useState, useEffect } from "react";
import HTMLFlipBook from "react-pageflip";
import { useLocation } from "react-router-dom";
import { toast } from 'react-hot-toast';
import jsPDF from "jspdf"; // Import jsPDF
import InsideNavbar from '../../components/Navbar/InsideNavbar';  
import GuestNavbar from '../../components/Navbar/Navbar';
import Footer from "../../components/Footer/Footer"; 
import Sidebar from '../../components/Sidebar/Sidebar';  
import Soundboard from '../../components/Soundboard/Soundboard'; 
import "./StoryPage.css";

import Paper from "../../assets/paper-mode.svg";
import FrontCover from "../../assets/book-front-cover.png";
import BackCover from "../../assets/book-back-cover.png";
import BackCover1 from "../../assets/book-back-cover1.png";
import LeftPageImg from "../../assets/book-left-page.png";
import RightPageImg from "../../assets/book-right-page.png";  
import aboutIMG from '../../assets/about-img.png';


import { TiDocumentText } from "react-icons/ti"; 
import { IoMdDownload } from "react-icons/io"; 
import { VscBook } from "react-icons/vsc";  
 
const Page = React.forwardRef((props, ref) => ( 
    <div className="page" ref={ref}>
        <div className="page-content">
            <img className="PageImage" src={props.image} alt="Page" />
            {props.content && <div className="page-text">{props.content}</div>}
        </div>
    </div>
));

const StoryPage = () => {
    const location = useLocation();
    const { title = "Generated Story", story = "" } = location.state || {};
    const [storyPages, setStoryPages] = useState([]);
    const [currentPage, setCurrentPage] = useState(0);
    const [isPaperMode, setIsPaperMode] = useState(false);   
    const [isShifted, setIsShifted] = useState(false);  
    const [flipbookKey, setFlipbookKey] = useState(0); 
    const [progressValue, setProgressValue] = useState(0);
    const bookRef = useRef();

    const width = window.innerWidth;
    const flipbookWidth = width >= 640 ? 350 : width / 2 - 5;
    const flipbookHeight = width >= 640 ? 490 : width * 1.3;  

    const handleFrontCoverClick = () => {
        if (currentPage === 0) {
            if (isShifted) {
                setIsShifted(false);
            } else {
                setIsShifted(true);
            }
        }
    }; 

    // Ensure floating effect is applied when front page (currentPage === 0) is shown
    useEffect(() => {
        if (currentPage === 0) {
            setIsShifted(true);  
        } else {
            setIsShifted(false);   // Reset shift effect
        }
    }, [currentPage]);
    
    useEffect(() => {
        // Reset key to force re-render whenever we are on the front page
        if (currentPage === 0) {
            setFlipbookKey(prevKey => prevKey + 1); 
        }
    }, [currentPage]);  


    useEffect(() => { 
        const cleanTitle = title.includes("[SEP]") ? title.split("[SEP]")[1].trim() : title;
        const cleanStory = story.includes("[SEP]") ? story.split("[SEP]")[1].trim() : story;

        const words = cleanStory.split(" ");
        const wordsPerPage = 50;
        const pages = [];

        for (let i = 0; i < words.length; i += wordsPerPage) {
            pages.push(words.slice(i, i + wordsPerPage).join(" "));
        }

        setStoryPages(pages);
    }, [title, story]); 


    const handlePageChange = (e) => {
        setCurrentPage(e.data);
    
        const progressBar = document.querySelector(".progress-bar");
        const totalPages = storyPages.length + 4; 
        const progressValue = e.data / (totalPages - 1);
    
        const progressWidth = progressValue === 0 ? 0 : Math.max(3, Math.min(97, progressValue * 100));
    
        progressBar.style.setProperty("--progress-width", `${progressWidth}%`);
    };
    
    const handleProgressBarChange = (event) => {
        const progressBar = event.target; 
        const totalPages = storyPages.length + 4; 
        
        const progressValue = parseFloat(progressBar.value) / 100;
    
        const progressValueAdjusted = Math.max(0.10, Math.min(0.90, progressValue));
    
        const newPage = Math.round(progressValueAdjusted * (totalPages - 1));
    
        bookRef.current.pageFlip().turnToPage(newPage);
    
        const progressWidth = progressValueAdjusted * 100;
    
        progressBar.style.setProperty("--progress-width", `${progressWidth}%`);
    };
    
    const handleDownloadPDF = () => {
        const doc = new jsPDF();
        
        const font = 'EfcoBrookshire';
        const fontBase64 = '';
    
        doc.addFileToVFS(font + '.ttf', fontBase64);
        doc.addFont(font + '.ttf', font, 'normal');
        
        // Add "Ang Tipo Kong Kwento" with custom font family
        const pageWidth = doc.internal.pageSize.width;
        const centerText = "Ang tipo kong Kwento";
        doc.setFontSize(18);
        doc.setFont(font, "normal"); // Use custom font here
        const centerTextWidth = doc.getTextWidth(centerText);
        doc.text(centerText, (pageWidth - centerTextWidth) / 2, 15); 
    
        // Extract and clean the title, and put it inside quotes
        const cleanTitle = title.includes("[SEP]") ? title.split("[SEP]")[1].trim() : title;
        const titleWithQuotes = `"${cleanTitle}"`; // Title inside quotes
    
        // Set the title font (default Helvetica) and size
        doc.setFontSize(18);
        doc.setFont("Lora", "bold");
        const titleWidth = doc.getTextWidth(titleWithQuotes);
        doc.text(titleWithQuotes, (pageWidth - titleWidth) / 2, 30); // Centered title below the center text
    
        // Add the story content
        doc.setFontSize(13);
        doc.setFont("Lora", "normal");
        const storyText = story.includes("[SEP]") ? story.split("[SEP]")[1].trim() : story;
    
        const marginLeft = 20;
        const marginRight = 20;
        const marginTop = 45; 
        const marginBottom = 20;
        const usableWidth = pageWidth - marginLeft - marginRight;
        const pageHeight = doc.internal.pageSize.height;
    
        const paragraphs = storyText.split(/\n\s*\n/); 
        let yPosition = marginTop;
        const lineHeight = doc.getLineHeight() * 0.6; 
        const indentWidth = 0; 
    
        paragraphs.forEach((paragraph) => {
            // Split paragraph into lines that fit within the usable width
            const lines = doc.splitTextToSize(paragraph.trim(), usableWidth);
    
            lines.forEach((line, lineIndex) => {
                if (lineIndex === 0) {
                    // Apply indentation only to the first line of the paragraph
                    doc.text(line, marginLeft + indentWidth, yPosition);
                } else {
                    // Normal alignment for subsequent lines of the paragraph
                    doc.text(line, marginLeft, yPosition);
                }
    
                // Move to the next line position
                yPosition += lineHeight;
    
                // Handle page overflow
                if (yPosition > pageHeight - marginBottom) {
                    doc.addPage();
                    yPosition = marginTop;
                }
            });
    
            // Add a small gap between paragraphs
            yPosition += lineHeight * 0.5; 
        });
    
        // Save the PDF
        doc.save(`${cleanTitle}.pdf`);
        toast.success('File was successfully downloaded.')
    };
    
    const isGuest = location.state?.isGuest || false;  

    // Customizable Paper view Font Size
    const [fontSize, setFontSize] = useState(18); 

    const increaseFontSize = () => {
    setFontSize((prev) => Math.min(prev + 2, 36)); 
    };

    const decreaseFontSize = () => {
    setFontSize((prev) => Math.max(prev - 2, 12));
    }; 
    
    return (
        <>
            <div className="storyContainer">
                {isGuest ? (
                    <>
                    <GuestNavbar />
                    <Sidebar />
                    </>
                ) : (
                    <InsideNavbar />
                )}
                <section className="story-page-container"> 
                    
                        <>  
                            {!isPaperMode && (  
                                <HTMLFlipBook 
                                key={flipbookKey}  
                                width={flipbookWidth}
                                height={flipbookHeight}
                                maxShadowOpacity={0.2}
                                showCover={true}
                                ref={bookRef}
                                onFlip={handlePageChange} 
                                className={`flipbook ${isShifted ? "shift-left" : ""}`}
                                > 
                            <div   
                            onClick={handleFrontCoverClick}>
                                <Page image={FrontCover}/>  
                            </div>
                                <Page image={BackCover} />
                                <Page
                                    image={RightPageImg}
                                    content={
                                        <>
                                            <p className="story-subtitle">Ang tipo kong Kwento</p>
                                            <h1 className="main-title">"{title.includes("[SEP]") ? title.split("[SEP]")[1].trim() : title}"</h1>
                                        </>
                                    }
                                />
                                 <Page image={LeftPageImg} content={storyPages[0]} />
                                {storyPages.slice(1).map((content, index) => (
                                    <Page
                                        key={index}
                                        image={index % 2 === 0 ? RightPageImg : LeftPageImg}
                                        content={<p>{content}</p>}
                                        />
                                ))} 


                                <Page image={BackCover1} />
                                <Page image={BackCover} />

                            </HTMLFlipBook>  
                        )}
                            {isPaperMode && (
                                <div className="paper-mode">
                                    <img src={Paper} alt="Paper Background" className="paper-image" /> 
                                     {/* FONT SIZE CONTROLS */}
                                    <div className="font-size-controls"> 
                                    <button onClick={increaseFontSize} className="font-size-button">A+</button>
                                        <button onClick={decreaseFontSize} className="font-size-button">A-</button>
                                    </div>  
                                    <div className="paper-content">
                                        <p className="story-subtitle">Ang tipo kong Kwento</p>
                                        <h1 className="main-title">"{title.includes("[SEP]") ? title.split("[SEP]")[1].trim() : title}"</h1>
                                        <div className="story-text">
                                            {(story.includes("[SEP]") ? story.split("[SEP]")[1].trim() : story)
                                                .split(/(?<=[.!?])\s+/) // Split by sentence boundaries
                                                .map((paragraph, index) => (
                                                    <p
                                                        key={index}
                                                        style={{
                                                            textIndent: "1.5em",
                                                            marginBottom: "1em",
                                                            fontSize: `${fontSize}px`,
                                                            whiteSpace: "pre-wrap"
                                                        }}
                                                        >
                                                         {paragraph.split(" ").map((word, wordIndex) => (
                                                            <span className="hover-word" key={wordIndex}>
                                                                {word}
                                                            </span>
                                                            )).reduce((acc, curr) => acc.concat(curr, " "), [])}
                                                    </p>
                                                ))} 
                                             <img src={aboutIMG} className='girlIMG' alt="" />  
                                                
                                        </div>
                                    </div>
                                </div>
                            )} 

                            <div className="progress-bar-container">
                                {!isPaperMode && (
                                    <input 
                                    type="range" 
                                    className="progress-bar" 
                                    value={progressValue} 
                                    min="0" 
                                    max="100" 
                                    onChange={handleProgressBarChange} 
                                />
                                
                                )}
                                <div
                                    className={`paper-icon ${isPaperMode ? "book-view" : "formal-view"}`}
                                    onClick={() => {
                                        setIsPaperMode(!isPaperMode); // Toggle the mode
                                        setProgressValue(0); // Reset the progress bar
                                    }}
                                >
                                    {isPaperMode ? <VscBook /> : <TiDocumentText />}
                                </div>

                                <div className="download-btn" onClick={handleDownloadPDF}>
                                    <IoMdDownload />
                                </div> 
                                <div>  
                                    <Soundboard/>
                                </div>
                            </div>

                        </>
                </section>
                <Footer isAlternative={true} />
            </div>
        </>
    );
};

export default StoryPage;
